iterations.yara_rule:
rule Bypass_Evasion
{
    meta:
        description = "Evasion bypass sequences targeting different exit paths"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,action2=skip,count=0"

    strings:
        $pattern0 = { 85 C0 0F 84 ?? ?? ?? ?? 8B 45 ?? }
        $pattern1 = { E8 ?? ?? ?? ?? 75 ?? ?? ?? ?? 6A ?? 5A }
        $pattern2 = { FF 5F 00 0F 84 ?? ?? ?? ?? 0F 85 C0 }

    condition:
        any of them
}

